window.bookSummaryJSON = "<p><b>On the world of Marconen, your first Break determines the trajectory of your life. Calvin chose magic.</b></p> <p>Without proper schooling or a mentor, the boy is dragged by the cruel whims of fate across the face of the planet, blending together different schools of magic and powerful abilities to create something new.</p> <p>But there's a deeper secret behind his success. Why was he born an exile from his country? Why is his System so strange, and why does it keep talking to him?</p> <p>As the march of time continues, something evil grows in power across the ocean.</p>"; 
